  01> LUDBROOK, Campbell John
  b 02.04.1971
  Campbell b. at Te Kuiti. He was educated at Pio Pio Primary School and St Paul's Collegiate in
  Hamilton. He graduated Bachelor of Business Management from Waikato University and is now a
  Chartered Accountant working in Auckland.
  02> LUDBROOK, Maria Rosanne
  b 18.06.1972
  Maria b. at Te Kuiti. She was educated Pio Pio Primary and Waikato Diocesan Schools then graduated
  Bachelor of Social Sciences from Waikato University. She is currently studying for her Masters in
  Psychology and a Diploma in Clinical Psychology at Waikato University.
  03> LUDBROOK, Sarah
  b 22.03.1976
  Sarah b. at Te Kuiti. She was educated at Pio Pio Primary School, Te Kuiti High School and Waikato
  Diocesan School. She then graduated Bachelor of Education from Waikato University and is now
  teaching at Te Awamutu Primary School.
