  b 05.05.1940
  b 27.06.1945
  02> LUDBROOK, Peter Wilson m on 20.07.1968 to BUDGE, Louise Margaret
  20.07.1968 to BUDGE , Louise Margaret
  b 21.10.1941
  b 07.12.1946
  Address: RD 1, Te Kuiti.
  Peter was educated at Piopio Primary School, Huntley School, Marton, and Wanganui Collegiate School. He
  is a cattle farmer in the Te Kuiti area who, because of ill-health, developed a low input cattle
  farming system. He is involved with tennis as both a player and administrator, and is also chairman of
  the Church Finance and Property Committee.
  Louise (Lisa) was raised in Lower Hutt and educated at Queen Margaret College, Wellington, and
  Wellington Teachers' College. Before marriage she taught in the Lower Hutt area and she is now a
  teacher of children with a specific learning disability.
  01> LUDBROOK, Richard Michael
  b 19.08.1970
  Richard was educated at Piopio Primary School and St Paul's Collegiate School, Hamilton, then
  graduated BCom from Canterbury University and gained a Post Graduate Diploma from Lincoln
  University. He is now a chartered accountant and worked for Ernst and Young in Auckland and is
  currently working in the UK.
  02> LUDBROOK, Hannah Mary
  b 11.09.1971
  Hannah was educated at Piopio Primary School and Waikato Diocesan School for Girls then graduated
  with a degree in Parks and Recreation from Lincoln University. She worked for the Wairarapa
  Outdoors Recreation Trust and for Sport Auckland and is currently working overseas.
